window.bookSummaryJSON = "<p><b>Jack and Annie are diving into danger when the magic tree house whisks them away to shark-infested waters in this next adventure in the <i>New York Times</i> best-selling Magic Tree House series!</b> </p> <p>It's a dream vacation for Jack and Annie - or is it? </p> <p>When Teddy, a young sorcerer, offers to send Jack and Annie on a dream vacation, they can't wait to go. The brother-and-sister pair wish for a trip to a beach paradise, and the magic tree house whisks them off to the coast of Mexico. Everything starts out perfectly as they raft around a coral reef. But then a hungry shark attacks! And their dream vacation turns into a nightmare! </p> <p>Have more fun with Jack and Annie in the Magic Tree House. </p>"; 
